DROP TABLE IF EXISTS public.PRODUTO;

CREATE TABLE public.PRODUTO (
  id SERIAL PRIMARY KEY,
  DESCRICAO varchar(255) default NULL,
  GRUPO integer NULL,
  SUB_GRUPO integer NULL,
  STATUS integer NULL,
  estoque numeric(14,2) NULL
);


UPDATE public.PRODUTO
SET STATUS = 1
WHERE STATUS = 0 AND ID > 100;

UPDATE public.PRODUTO
SET DESCRICAO = 'PRODUTO ' || ID;

COMMIT;